import styled from 'styled-components';

function KatePage () {
    return(
        <Background>
            <TitleWrapper>
                <Title>Hi Kate!</Title>
            </TitleWrapper>
        </Background>
    );
}

const Background = styled.div`
    height: 100vh;
    width: 100%;
    background: pink;
    display: flex;
    justify-content: center;

`;

const Title = styled.h1`
    margin-top: 100px;
    color: white;
    font-size: 112px;
`;

const  TitleWrapper = styled.div`
    display: flex;
    height: 100px;
    border-radius: 8px;
    border: 2px solid white;
`;

export default KatePage;
